import './assets/scss/stylesheet.scss';
import Home from './pages/Home/Home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar/NavBar';
import DestinoPage from './pages/DestinoPage/DestinoPage.js';
import ContactoPage from './pages/ContactoPage/ContactoPage';
import AboutPage from './pages/AboutPage/AboutPage';
import PaquetesPage from './pages/PaquetesPage/PaquetesPage';
import PreguntaPage from './pages/PreguntaPage/PreguntaPage';
import Info1Page from './pages/Info1Page/Info1Page';
import Info2Page from './pages/Info2Page/Info2Page';
import Footer from './components/Footer/Footer';

let navBarOptions = [
  { option: 'Home', to: '/' },
  { option: 'Acerca de nosotros', to: '/about' },
  { option: 'Paquetes', to: '/paquetes' },
  { option: 'Destinos', to: '/destino' },
  { option: 'Preguntas Frecuentes', to: '/pregunta' },
  { option: 'Contacto', to: '/contacto' },
  

];


function App() {
  return (
    <BrowserRouter>
      <NavBar navBarOptions={navBarOptions} />
      <div className="App ">
        <Routes>
          <Route index element={<Home />} />          
          <Route path="Ux/Ui" element={<DestinoPage />} />
          <Route path="Desarrollo Web" element={<ContactoPage />} />
          <Route path="aDiseño Gráfico" element={<AboutPage />} />
          <Route path="About" element={<PaquetesPage />} />
          <Route path="pregunta" element={<PreguntaPage />} />
          <Route path="informacion-disney" element={<Info1Page />} />
          <Route path="informacion-legoland" element={<Info2Page />} />

        </Routes>
      </div>
      <Footer/>
      
    </BrowserRouter>
    
  );
}

export default App;
